        x = document.getElementById("mysearch").value.toLowerCase()
        document.getElementById("tbody").innerHTML=""

            if (s["Name of Commodity"].toLowerCase().search(x) > -1) {
                // console.log(s)
                document.getElementById("tbody").innerHTML+=`

                <td>${s["GST ( %)"]||"NIL"}</td>

        })
